const TotalMoney = ({ listTransactions }) => {
  return (
    <div className="Div-total">
      <div>
        <p>Valor Total:</p>
      </div>
      <div>
        {listTransactions.reduce(
          (acc, total) => (
            <p>${acc + total.value}</p>
          ),
          0
        )}
      </div>
    </div>
  );
};
export default TotalMoney;
